import React from "react";
import { useHistory } from "react-router-dom";

import { Container, ButtonPerson, ButtonProduct } from "./styles";

const Home: React.FC = () => {
  const location = useHistory();
  return (
    <Container>
      <button onClick={() => location.push("/RegisterClient")} type="button">
        <ButtonPerson>Cadastrar Pessoas</ButtonPerson>
      </button>
      <button onClick={() => location.push("/RegisterClient")} type="button">
        <ButtonProduct>Cadastrar Produto</ButtonProduct>
      </button>
    </Container>
  );
};

export default Home;
